import React from 'react';
import Navigation from '../navigation/Navigation';
const Ajout = () => {
    return (
        <div>
            <h3>Page Ajout</h3>
            <Navigation />

            <form action="">
                <label htmlFor="">Nom</label><input type="text" placeholder='ajouter client' />
                <br />
                <label htmlFor="">prenom</label><input type="text" placeholder='ajouter client' /><br />
                <button type="submit">Submit</button>

            </form>
        </div>
    );
};

export default Ajout;
